import React, { useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { Link } from 'react-router-dom';

import { getEventList } from '../../Action/EventAction'
import { RootState } from '../../Reducer'

interface Iuid {
    uid: string
}

function EventList({uid}:Iuid){

    const [_uid, setUid] = useState<string>(uid);

    let dispatch = useDispatch()
    let event = useSelector((state: RootState) => state.EventReducer) 

    React.useEffect(() => {

        setUid(uid)
        dispatch(getEventList(_uid))

        return(
            console.log('terminate')
        )
    }, [dispatch, setUid])

    return(
        <div>
            {
            event.eventList.map((e,key) => {

                return(
                <>
                    <div key={key}>
                        <div key={key}>Id: {e.id}</div>
                        <div key={e.id}>date time: {e.dateTime}</div>
                        <div key={e.id}>event name: {e.eventName}</div>
                        <div key={e.id}>memo: {e.memo}</div>

                        <li>
                            <Link to={`/detail/${e.id}`}>View</Link>
                        </li>

                        <Link to={`/edit/${e.id}`}>
                            <button>Edit</button>
                        </Link>

                        <hr></hr>
                    </div>
                </>
                )
            })
            }
        </div>
    )
}

export default EventList
